enu','Post Type List'=>'Liste de Type d’article','Taxonomy List'=>'Liste de sites web','%s value is required'=>'le champ %s est obligatoire','Active <span class="count">(%s)</span>'=>'Actif <span class="count">(%s)</span>' . "\0" . 'Actif <span class="count">(%s)</span>','Export '=>'Exporter ','Active'=>'Actif','Inactive'=>'Inactif','Export'=>'Exporter','%s updated.'=>'%s mis à jour.','%s deleted.'=>'%s supprimé.','%s published.'=>'%s publié.','%s saved.'=>'%s sauvegardé.','%s submitted.'=>'%s a été soumis.','%s scheduled.'=>'%s programmé.','%s draft updated.'=>'%s brouillon mis à jour.','View'=>'Voir','copy'=>'copier','Reset'=>'Réinitialiser','Author'=>'Auteur','Block Type'=>'Type de bloc','A unique name that identifies the block (without namespace).<br />Note: A block name can only contain lowercase alphanumeric characters and dashes, and must begin with a letter.'=>'Nom unique qui identifie le bloc (sans espace de noms).<br />Remarque : Un nom de bloc ne peut contenir que des caractères alphanumériques minuscules et des tirets, et doit commencer par une lettre.','This is a short description for your block.'=>'Ceci est une brève description de votre bloc.','Blocks are grouped into categories to help users browse and discover them. The core provided categories are [ common | formatting | layout | widgets | embed ]. Plugins and Themes can also register custom block categories.<br /><br />Plugins and Themes can also register <a href="https://developer.wordpress.org/block-editor/reference-guides/filters/block-filters/#managing-block-categories" target="_blank">custom block categories</a>.'=>'Les blocs sont regroupés en catégories pour aider les utilisateurs à les parcourir et à les découvrir. Les catégories de base fournies sont [ common | formatting | layout | widgets | embed ]. Les plugins et les thèmes peuvent également enregistrer des catégories de blocs personnalisées.<br /><br />Les plugins et les thèmes peuvent également enregistrer <a href="https://developer.wordpress.org/block-editor/reference-guides/filters/block-filters/#managing-block-categories" target="_blank">des catégories de blocs personnalisées</a>.','An array of search terms to help user discover the block while searching.<br />One line for each keyword. ie:<br /><br />quote<br />mention<br />cite'=>'Tableau de termes de recherche pour aider l’utilisateur à découvrir le bloc lors de la recherche.<br />Une ligne pour chaque mot-clé. Ie:<br /><br />citer<br />mentionner<br />citer','An array of post types to restrict this block type to.'=>'Tableau de types de publication auxquels restreindre ce type de bloc.','The display mode for your block. Available settings are "auto", "preview" and "edit". Defaults to "preview".<br /><br /><strong>Preview</strong>: Preview is always shown. Edit form appears in sidebar when block is selected.<br /><strong>Auto</strong>: Preview is shown by default but changes to edit form when block is selected.<br /><strong>Edit</strong>: Edit form is always shown.<br /><br />Note. When in "preview" or "edit" modes, an icon will appear in the block toolbar to toggle between modes.'=>'Le mode d’affichage de votre bloc. Les paramètres disponibles sont auto", "preview" et "edit". La valeur par défaut est « aperçu ».<br /><br /><strong>Preview</strong> : l’aperçu est toujours affiché. Modifier le formulaire apparaît dans la barre latérale lorsque le bloc est sélectionné.<br /><strong>Auto</strong> : l’aperçu est affiché par défaut, mais change pour modifier le formulaire lorsque le bloc est sélectionné.<br /><strong>Edit</strong> : le formulaire d\'édition est toujours affiché.<br /><br />Note. En mode "preview" ou "edit", une icône apparaît dans la barre d’outils de bloc pour basculer entre les modes.','The default block alignment. Available settings are "left", "center", "right", "wide" and "full". Defaults to an empty string.'=>'Alignement des blocs par défaut. Les paramètres disponibles sont "left", "center", "right", "wide" et "full". Par défaut, il s’agit d’une chaîne vide.','The default block text alignment (see supports setting for more info). Available settings are "left", "center" and "right". Defaults to the current language\'s text alignment.'=>'L’alignement du texte de bloc par défaut (voir le paramètre de prise en charge pour plus d’informations). Les paramètres disponibles sont "left", "center" et "right". Par défaut, l’alignement du texte de la langue actuelle.','The default block content alignment (see supports setting for more info). Available settings are "top", "center" and "bottom".<br /><br />When utilising the "Matrix" control type, additional settings are available to specify all 9 positions from “top left” to “bottom right”. Defaults to "top".'=>'L’alignement du contenu de bloc par défaut (voir le paramètre de prise en charge pour plus d’informations). Les paramètres disponibles sont "top", "center" et "bottom".<br /><br />Lors de l’utilisation du type de champ "Matrix", des paramètres supplémentaires sont disponibles pour spécifier les 9 positions de “top left” à “bottom right”. La valeur par défaut est "top".','Enable Anchor attribute. Defaults to false'=>'Activez l’attribut Anchor. La valeur par défaut est false','Parse the block HTML as JSX for the Inner Block Component to function within the React based block editor.'=>'Analysez le bloc HTML au format JSX pour que le composant de bloc interne fonctionne dans l’éditeur de blocs basé sur React.','This property adds block controls which allow the user to change the block’s alignment. Defaults to true. Set to false to hide the alignment toolbar. Set to an array of specific alignment names to customize the toolbar.'=>'Cette propriété ajoute des contrôles de bloc qui permettent à l’utilisateur de modifier l’alignement du bloc. La valeur par défaut est true. Affectez la valeur false pour masquer la barre d’outils d’alignement. Définissez un tableau de noms d’alignement spécifiques pour personnaliser la barre d’outils.','Set to an array of specific alignment names to customize the toolbar.<br />One line for each name. ie:<br /><br />left<br />right<br />full'=>'Définissez un tableau de noms d’alignement spécifiques pour personnaliser la barre d’outils.<br />Une ligne pour chaque nom. Ie:<br /><br />left<br />right<br />full','This property enables a toolbar button to control the block’s text alignment. Defaults to false. Set to true to show the alignment toolbar button.'=>'Cette propriété active un bouton de barre d’outils pour contrôler l’alignement du texte du bloc. La valeur par défaut est false. Affectez la valeur true pour afficher le bouton de la barre d’outils d’alignement.','This property enables a toolbar button to control the block’s inner content alignment. Defaults to false. Set to true to show the alignment toolbar button, or set to "matrix" to enable the full alignment matrix in the toolbar'=>'Cette propriété permet à un bouton de barre d’outils de contrôler l’alignement du contenu interne du bloc. La valeur par défaut est false. Définissez sur true pour afficher le bouton de la barre d’outils d’alignement, ou sur "matrix" pour activer la matrice d’alignement complète dans la barre d’outils','This property enables the full height button on the toolbar of a block'=>'Cette propriété active le bouton pleine hauteur dans la barre d’outils d’un bloc','This property allows the user to toggle between edit and preview modes via a button. Defaults to true.'=>'Cette propriété permet à l’utilisateur de basculer entre les modes d’édition et d’aperçu via un bouton. La valeur par défaut est true.','This property allows the block to be added multiple times. Defaults to true.'=>'Cette propriété permet d’ajouter le bloc plusieurs fois. La valeur par défaut est true.','Simple: Specify a Dashicons class or SVG path<br />Colors: Specify colors & Dashicons class'=>'Simple : Spécifier une classe Dashicons ou un chemin SVG<br />Couleurs : Spécifier les couleurs et la classe Dashicons','An icon property can be specified to make it easier to identify a block. These can be any of WordPress’ Dashicons, or a custom svg element.'=>'Une propriété d’icône peut être spécifiée pour faciliter l’identification d’un bloc. Il peut s’agir de l’un des Dashicons de WordPress ou d’un élément svg personnalisé.','Specifying a background color to appear with the icon e.g.: in the inserter.'=>'Spécification d’une couleur d’arrière-plan à afficher avec l’icône, par exemple : dans l’inserteur.','Specifying a color for the icon (optional: if not set, a readable color will be automatically defined)'=>'Spécification d’une couleur pour l’icône (facultatif : si elle n’est pas définie, une couleur lisible sera automatiquement définie)','Specifying a dashicon for the block'=>'Spécification d’un dashicon pour le bloc','The path to a template file used to render the block HTML. This can either be a relative path to a file within the active theme, parent theme, wp-content directory or a full path to any file.'=>'Chemin d’accès à un fichier de modèle utilisé pour afficher le bloc HTML. Il peut s’agir d’un chemin relatif à un fichier dans le thème actif, le thème parent, le répertoire wp-content ou un chemin complet vers n’importe quel fichier.','Instead of providing a render_template, a callback function name may be specified to output the block\'s HTML.'=>'Au lieu de fournir un render_template, un nom de fonction de rappel peut être spécifié pour générer le code HTML du bloc.','The url to a .css file to be enqueued whenever your block is displayed (front-end and back-end). This can either be a relative path to a file within the active theme, parent theme, wp-content directory or a full path to any file.'=>'L’URL d’un fichier .css à mettre en file d’attente chaque fois que votre bloc est affiché (front-end et back-end). Il peut s’agir d’un chemin relatif à un fichier dans le thème actif, le thème parent, le répertoire wp-content ou un chemin complet vers n’importe quel fichier.','The url to a .js file to be enqueued whenever your block is displayed (front-end and back-end). This can either be a relative path to a file within the active theme, parent theme, wp-content directory or a full path to any file.'=>'L’URL d’un fichier .js à mettre en file d’attente chaque fois que votre bloc est affiché (front-end et back-end). Il peut s’agir d’un chemin relatif à un fichier dans le thème actif, le thème parent, le répertoire wp-content ou un chemin complet vers n’importe quel fichier.','A callback function that runs whenever your block is displayed (front-end and back-end) and enqueues scripts and/or styles.'=>'Une fonction de rappel qui s’exécute chaque fois que votre bloc est affiché (front-end et back-end) et met en file d’attente les scripts et/ou les styles.','Block Types'=>'Types de Blocs','Edit Block Type'=>'Editer le Type de Bloc','New Block Type'=>'Nouveau Type de Bloc','Block Type Title'=>'Titre du Type de Bloc','Export Block Types'=>'Exporter les types de bloc','Select Block Types'=>'Sélectionner les types de bloc','No block type available.'=>'Aucun type de bloc dynamique disponible.','No block types selected'=>'Aucun type de bloc sélectionné','1 block type exported'=>'1 type de bloc exporté','%s block types exported'=>'%s types de bloc exportés','It is recommended to include this code within the <code>acf/init</code> hook (<a href="%s" target="blank">see documentation</a>).'=>'Il est recommandé d’inclure ce code dans le hook <code>acf/init</code> (<a href="%s" target="blank">voir documentation</a>).','Import Block Types'=>'Importer des types de bloc','1 block type imported'=>'1 type de bloc importé','%s block types imported'=>'%s types de bloc importés','Posts'=>'Articles','This block type already exists'=>'Ce type de bloc existe déjà','Select bulk action'=>'Sélectionnez l’action groupée','Bulk Actions'=>'Actions groupées','Apply'=>'Appliquer','WP Options Meta'=>'Meta d\'Options WP','WP Custom Fields'=>'Champs personnalisés WP','ACF Options Meta'=>'Meta d