erreur a été précédemment affichée','Hide confirmation on exit'=>'Masquer la confirmation à la sortie','Do not prompt user on page refresh'=>'Ne pas avertir l\'utilisateur lors du rafraîchissement de la page','General error messages'=>'Messages d\'erreur généraux','Customize general error messages.'=>'Personnaliser les messages d\'erreur généraux.','Fields errors position'=>'Position des erreurs des champs','Choose where to display field errors'=>'Choisir l\'endroit où afficher les erreurs de champ','Below fields'=>'Sous les champs','Group errors'=>'Grouper les erreurs','Hide errors'=>'Masquer les erreurs','Fields errors class'=>'Classe des erreurs des champs','Add class to the error message'=>'Ajouter une classe au message d\'erreur','Success'=>'Succès','Redirection'=>'Redirection','The URL to be redirected to after the form is submitted.'=>'L\'URL à rediriger après l\'envoi du formulaire.','This setting is deprecated, use the new "Redirect Action" instead.'=>'Ce paramètre est obsolète, utilisez le nouveau "Action de Redirection" à la place.','Hide form'=>'Masquer le formulaire','Hide form on successful submission'=>'Masquer le formulaire en cas de soumission réussie','Scroll to message'=>'Défiler jusqu\'au message','Scroll to message on success'=>'Faire défiler le message en cas de succès','Success message'=>'Message de succès','The message displayed above the form after the submission.'=>'Le message affiché au dessus du formulaire à la soumission.','Form updated'=>'Formulaire mis à jour','Success wrapper HTML'=>'Wrapper HTML du message de succès','HTML used to render the updated message.'=>'HTML utilisé pour afficher le message mis à jour.','If used, you have to include the following code <code>%s</code> to print the actual "Success message" above.'=>'Si l\'utilisé, vous devez inclure le code suivant <code>%s</code> pour afficher le "message de succès" ci-dessus.','Validation failed'=>'Échec de la validation','Validate Email'=>'Valider l’adresse e-mail','Set a unique action slug.'=>'Définissez un identifiant d’action unique.','Post updated'=>'Article mis à jour','Edit Form'=>'Éditer le formulaire','New Form'=>'Nouveau formulaire','Form Title'=>'Titre du formulaire','Export Forms'=>'Exporter Formulaires','Select Forms'=>'Sélectionner Formulaires','No form available.'=>'Aucun formulaire disponible.','No forms selected'=>'Aucun formulaire sélectionné','1 form exported'=>'1 formulaire exporté','%s forms exported'=>'%s formulaires exportés','It is recommended to include this code within the <code>acfe/init</code> hook.'=>'Il est recommandé d’inclure ce code dans le hook <code>acfe/init</code>.','Import Forms'=>'Importer des formulaires','1 form imported'=>'1 formulaire importé','%s forms imported'=>'%s formulaires importés','Shortcode'=>'Shortcode','Validation successful'=>'Validation réussie','1 field requires attention'=>'1 champ demande votre attention','%d fields require attention'=>'%d champs demandent votre attention','Integration'=>'Intégration','Template Tags'=>'Étiquettes de modèle','Hooks'=>'Hooks','Helpers'=>'Aides','Guides'=>'Guides','Dummy Title & Content Fields'=>'Champs de titre et de contenu factices','Hide a Field on Front-End'=>'Masquer un champ sur le front-end','Passing Data to a Form'=>'Transmettre des données à un formulaire','Using Actions Output Data'=>'Utiliser les données des actions','Shortcodes'=>'Shortcodes','PHP code'=>'Code PHP','This form name already exists'=>'Ce nom de formulaire existe déjà','Option'=>'Option','No options avaliable.'=>'Aucune option disponible.','ID'=>'ID','Option has been deleted'=>'L’option a été supprimée','Options have been deleted'=>'Les options on été supprimées','Option has been updated'=>'L’option a été mise à jour','Option has been added'=>'L’option a été ajoutée','Edit field group'=>'Modifier groupe de champs','Options Page'=>'Options de la Page','The URL slug used to uniquely identify this options page. Defaults to a url friendly version of Menu Title'=>'Le slug d’URL utilisé pour identifier de manière unique cette page d’options. Par défaut, une version conviviale pour l’URL du Titre du menu','The title displayed in the wp-admin sidebar. Defaults to Page Title'=>'Le titre affiché dans la barre latérale wp-admin. Titre de page par défaut','The capability required for this menu to be displayed to the user. Defaults to edit_posts.<br /><br />Read more about capability here: <a href="https://wordpress.org/support/article/roles-and-capabilities/" target="_blank">https://wordpress.org/support/article/roles-and-capabilities/</a>'=>'Capacité requise pour que ce menu soit affiché à l’utilisateur. La valeur par défaut est edit_posts.<br /><br />En savoir plus sur la capacité ici: <a href="https://wordpress.org/support/article/roles-and-capabilities/" target="_blank">https://wordpress.org/support/article/roles-and-capabilities/</a>','The position in the menu order this menu should appear. Defaults to bottom of utility menu items.<br /><br />WARNING: if two menu items use the same position attribute, one of the items may be overwritten so that only one item displays!<br />Risk of conflict can be reduced by using decimal instead of integer values, e.g. 63.3 instead of 63.'=>'La position dans l’ordre de menu de ce menu devrait apparaître. Valeur par défaut au bas des éléments de menu de l’utilitaire.<br /><br />ATTENTION : si deux rubriques de menu utilisent le même attribut position, l’une des rubriques peut être écrasée afin qu’une seule rubrique s’affiche !<br />Le risque de conflit peut être réduit en utilisant des valeurs décimales au lieu de valeurs entières, par exemple 63,3 au lieu de 63.','The slug of another WP admin page. if set, this will become a child page.'=>'Le slug d’une autre page d’administration WP. Si elle est définie, cette page deviendra une page enfant.','The icon class for this menu. Defaults to default WordPress gear.<br /><br />Read more about dashicons here: <a href="https://developer.wordpress.org/resource/dashicons/" target="_blank">https://developer.wordpress.org/resource/dashicons/</a>'=>'Classe d’icônes de ce menu. Par défaut, l’équipement WordPress est utilisé.<br /><br />En savoir plus sur les dashicons ici: <a href="https://developer.wordpress.org/resource/dashicons/" target="_blank">https://developer.wordpress.org/resource/dashicons/</a>','If set to true, this options page will redirect to the first child page (if a child page exists). If set to false, this parent page will appear alongside any child pages. Defaults to true'=>'Si elle est définie sur true, cette page d’options redirigera vers la première page enfant (si une page enfant existe). Si elle est définie sur false, cette page parent apparaîtra à côté des pages enfants. La valeur par défaut est true','The <code>$post_id</code> to save/load data to/from. Can be set to a numeric post ID (123), or a string (\'user_2\'). Defaults to \'options\'.'=>'Le <code>$post_id</code> pour enregistrer/charger des données vers/depuis. Peut être défini sur un ID de publication numérique (123) ou une chaîne (\'user_2\'). La valeur par défaut est \'options\'.','Whether to load the option (values saved from this options page) when WordPress starts up. Defaults to false.'=>'S’il faut charger l’option (valeurs enregistrées à partir de cette page d’options) au démarrage de WordPress. La valeur par défaut est false.','The update button text.'=>'Le texte du bouton de mise à jour.','The message shown above the form on submit.'=>'Le message affiché au dessus du formulaire à la soumission.','Options Pages'=>'Pages d\'Options','Edit Options Page'=>'Editer la Page d\'Options','New Options Page'=>'Nouvelle Page d\'Options','Options Page Title'=>'Titre de la Page d\'Options','Export Options Pages'=>'Exporter les Pages d\'Options','Select Options Pages'=>'Sélectionnez les Pages d\'Options','No options page available.'=>'Aucune page d\'options disponible.','No options pages selected'=>'Aucune page d’options sélectionnée','1 options page exported'=>'1 page d\'options exportée','%s options pages exported'=>'%s pages d\'options exportées','Import Options Pages'=>'Importer les Pages d\'Options','1 options page imported'=>'1 page d\'options importée','%s options pages imported'=>'%s pages d\'options importées','Menu slug'=>'Identifiant de menu','Post ID'=>'ID de l\'article','Position'=>'Position','Options Updated'=>'Options mis à jour','This options page slug already exists'=>'Ce slug de page d’options existe déjà','Ready'=>'Prêt','Performance Mode is active.'=>'Le mode Performance est actif.','The \'%s\' meta was found on this object and is effective.'=>'La méta \'%s\' a été trouvée sur cet objet et est effective.','Performance Mode is ready.'=>'Le mode Performance est prêt.','The \'%s\' meta will be created when object will be saved.'=>'La méta \'%s\' sera créée lorsque l’objet sera enregistré.','Hybrid meta found'=>'Méta Hybride trouvée','Hybrid engine \'%s\' meta found.'=>'Méta Hybride \'%s\' trouvée.','This meta will be converted to Ultra engine upon save.'=>'Cette méta sera convertie en Ultra lors de la sauvegarde.','Ultra meta found'=>'Méta Ultra trouvée','Ultra engine \'%s\' meta found.'=>'Méta Ultra \'%s\' trouvée.','This meta will be converted to Hybrid engine upon save.'=>'Cette méta sera convertie en moteur Hybride lors de la sauvegarde.','Performance Mode'=>'Mode Performance','Test Drive'=>'Test','Production'=>'Production','Rollback'=>'Restauration','Engine'=>'Moteur','Status'=>'Statut','Save as individual meta'=>'Enregistrer en tant que méta individuelle','Save the field as an individual meta.'=>'Enregistrez le champ en tant que méta individuel.','View post'=>'Voir','Preview post'=>'Aperçu','%1$s at %2$s'=>'%1$s à %2$s','publish box date format' . "\4" . 'M j, Y'=>'M j, Y','publish box time format' . "\4" . 'H:i'=>'H:i','Post Type'=>'Type de publication','Post type key. Must not exceed 20 characters and may only contain lowercase alphanumeric characters, dashes, and underscores. See <a href="https://developer.wordpress.org/reference/functions/sanitize_key/" target="_blank">sanitize_key()</a>.'=>'Identifiant de type de publication. Ne doit pas dépasser 20 caractères et ne peut contenir que des caractères alphanumériques, des tirets et des traits de soulignement minuscules. Voir <a href="https://developer.wordpress.org/reference/functions/sanitize_key/" target="_blank">sanitize_key()</a>.','A short descriptive summary of what the post type is.'=>'Un petit résumé pour décrire de quel type de post il s\'agit.','Whether the post type is hierarchical (e.g. page). Allows Parent to be specified. The <code>supports</code> parameter should contain \'page-attributes\' to show the parent select box on the editor page. Default false.'=>'Si le type de publication est hiérarchique (par exemple, page). Permet de spécifier Parent. Le <code>supports</code> paramètre doit contenir \'page-attributes\' pour afficher la zone de sélection parent sur la page de l’éditeur. Valeur par défaut false.','Core feature(s) the post type supports. Serves as an alias for calling <a href="https://developer.wordpress.org/reference/functions/add_post_type_support/" target="_blank">add_post_type_support()</a> directly. Default is an array containing \'title\' and \'editor\'.'=>'Fonctionnalité(s) principale(s) prise en charge par le type de publication. Sert d’alias pour appeler directement <a href="https://developer.wordpress.org/reference/functions/add_post_type_support/" target="_blank">add_post_type_support()</a>. La valeur par défaut est un tableau contenant \'title\' et \'editor\'.','An array of taxonomy identifiers that will be registered for the post type. Taxonomies can be registered later with <a href="https://developer.wordpress.org/reference/functions/register_taxonomy/" target="_blank">register_taxonomy()</a> or <a href="https://developer.wordpress.org/reference/functions/register_taxonomy_for_object_type/" target="_blank">register_taxonomy_for_object_type()</a>.'=>'Tableau d’identificateurs de taxonomie qui seront enregistrés pour le type de publication. Les taxonomies peuvent être enregistrées ultérieurement avec <a href="https://developer.wordpress.org/reference/functions/register_taxonomy/" target="_blank">register_taxonomy()</a> ou <a href="https://developer.wordpress.org/reference/functions/register_taxonomy_for_object_type/" target="_blank">register_taxonomy_for_object_type()</a>.','Controls how the type is visible to authors (<code>show_in_nav_menus</code>, <code>show_ui</code>) and readers (<code>exclude_from_search</code>, <code>publicly_queryable</code>). Default: false.'=>'Contrôle la visibilité du type par les auteurs (<code>show_in_nav_menus</code>, <code>show_ui</code>) et les lecteurs (<code>exclude_from_search</code>, <code>publicly_queryable</code>). Valeur par défaut : false.','Whether to exclude posts with this post type from front end search results. Default: value of the opposite of <code>public</code> argument'=>'S’il faut exclure les publications avec ce type de publication des résultats de recherche frontaux. Valeur par défaut : valeur de l’opposé de l’argument <code>public</code>','Whether queries can be performed on the front end as part of <code>parse_request()</code>. Default: value of <code>public</code> argument.'=>'Si les requêtes peuvent être exécutées sur le serveur frontal dans le cadre de <code>parse_request()</code>. Valeur par défaut : valeur de l’argument <code>public</code> .','Can this post_type be exported. Default: true.'=>'Ce post_type peut-il être exporté? Valeur par défaut : true.','Whether to delete posts of this type when deleting a user.<br/><br/>If true, posts of this type belonging to the user will be moved to trash when then user is deleted.<br/><br/>If false, posts of this type belonging to the user will not be trashed or deleted.<br/><br/>If not set (the default), posts are trashed if <code>post_type_supports(\'author\')</code>. Otherwise posts are not trashed or deleted. Default: null.'=>'S’il faut supprimer des publications de ce type lors de la suppression d’un utilisateur.<br/><br/>Si la valeur est true, les messages de ce type appartenant à l’utilisateur seront déplacés vers la corbeille lorsque l’utilisateur sera supprimé.<br/><br/>Si elles sont fausses, les publications de ce type appartenant à l’utilisateur ne seront ni supprimées ni supprimées.<br/><br/>S’il n’est pas défini (valeur par défaut), les publications sont supprimées si <code>post_type_supports(\'author\')</code>. Sinon, les messages ne sont pas supprimés ou supprimés. Valeur par défaut : null.','The position in the menu order the post type should appear. <code>show_in_menu</code> must be true. Default: null – defaults to below Comments.'=>'La position dans l’ordre du menu le type de publication doit apparaître. <code>show_in_menu</code> doit être vrai. Valeur par défaut : null – par défaut sous Commentaires.','The url to the icon to be used for this menu or the name of the icon from the iconfont (<a href="https://developer.wordpress.org/resource/dashicons/" target="_blank">Dashicons</a>). Default: null – defaults to the posts icon.'=>'L’URL de l’icône à utiliser pour ce menu ou le nom de l’icône de l’iconfont (<a href="https://developer.wordpress.org/resource/dashicons/" target="_blank">Dashicons</a>). Valeur par défaut : null – par défaut sur l’icône des publications.','Whether to generate a default UI for managing this post type in the admin. Default: value of <code>public</code> argument'=>'S’il faut générer une interface utilisateur par défaut pour gérer ce type de publication dans l’admin. Valeur par défaut : valeur de l’argument <code>public</code>','Where to show the post type in the admin menu. <code>show_ui</code> must be true. Default: value of <code>show_ui</code> argument'=>'Où afficher le type de publication dans le menu d’administration. <code>show_ui</code> doit être vrai. Valeur par défaut : valeur de l’argument <code>show_ui</code>','If an existing top level page such as <code>tools.php</code> or <code>edit.php?post_type=page</code>, the post type will be placed as a sub menu of that.'=>'Si une page de niveau supérieur existante telle que <code>tools.php</code> ou <code>edit.php?post_type=page</code>, le type de publication sera placé en tant que sous-menu de celle-ci.','Whether post_type is available for selection in navigation menus. Default: value of <code>public</code> argument'=>'Si le post_type est disponible pour la sélection dans les menus de navigation. Valeur par défaut : valeur de l’argument <code>public</code>','Whether to make this post type available in the WordPress admin bar. Default: value of <code>show_in_menu</code> argument'=>'S’il faut rendre ce type de publication disponible dans la barre d’administration WordPress. Valeur par défaut : valeur de l’argument <code>show_in_menu</code>','Which template file to load for the archive query. Default: <a href="https://developer.wordpress.org/themes/basics/template-hierarchy/" target="_blank">Template hierarchy</a>'=>'Fichier de modèle à charger pour la requête d’archive. Valeur par défaut : <a href="https://developer.wordpress.org/themes/basics/template-hierarchy/" target="_blank">Hiérarchie des modèles</a>','Enables post type archives. Default: false'=>'Active les archives de type post. Valeur par défaut : false','Will use <code>name</code> as archive slug by default.'=>'Utilisera <code>name</code> comme slug d’archive par défaut.','Number of posts to display in the archive page. Default: 10'=>'Nombre de messages à afficher dans la page d’archives. Valeur par défaut : 10','Sort retrieved posts by parameter in the archive page. Default: date (<code>post_date</code>).'=>'Triez les posts  récupérés par paramètre dans la page d’archive. Valeur par défaut : date (<code>post_date</code>).','Designates the ascending or descending order of the <code>orderby</code> parameter in the archive page. Default: DESC.'=>'Désigne l’ordre croissant ou décroissant du paramètre dans la page d’archive <code>orderby</code> . Valeur par défaut : DESC.','Custom field used for the <code>orderby</code> parameter in the archive page'=>'Champ personnalisé utilisé pour le <code>orderby</code> paramètre dans la page d’archive','Custom field type (NUMERIC, BINARY, CHAR, DATE, DATETIME, DECIMAL, SIGNED, TIME, UNSIGNED) used for the <code>orderby</code> parameter in the archive page'=>'Type de champ personnalisé (NUMERIC, BINARY, CHAR, DATE, DATETIME, DECIMAL, SIGNED, TIME, UNSIGNED) utilisé pour le paramètre <code>orderby</code> dans la page d’archive','Which template file to load for the single query. Default: <a href="https://developer.wordpress.org/themes/basics/template-hierarchy/" target="_blank">Template hierarchy</a>'=>'Fichier de modèle à charger pour la requête de page unique. Valeur par défaut : <a href="https://developer.wordpress.org/themes/basics/template-hierarchy/" target="_blank">Hiérarchie des modèles</a>','Triggers the handling of rewrites for this post type. To prevent rewrites, set to false. Default: true and use <code>name</code> as slug'=>'Déclenche la gestion des réécritures pour ce type de publication. Pour empêcher les réécritures, définissez sur false. Valeur par défaut : true et utiliser <code>name</code> comme slug','Customize the permalink structure slug. Defaults to the <code>name</code> value. Should be translatable.'=>'Personnalisez le slug de structure de permalien. Valeur par <code>name</code> défaut. Devrait être traduisible.','Should the permalink structure be prepended with the front base. (example: if your permalink structure is <code>/blog/</code>, then your links will be: false-><code>/news/</code>, true-><code>/blog/news/</code>). Defaults to true.'=>'Si la structure du permalien doit être précédée de la base avant. (Exemple : si votre structure de permalien est <code>/blog/</code>, alors vos liens seront : false-><code>/news/</code>, true-><code>/blog/news/</code>). La valeur par défaut est true.','Should a feed permalink structure be built for this post type. Defaults to <code>has_archive</code> value.'=>'Une structure de permalien feed doit-elle être construite pour ce type de contenu. Valeur par défaut <code>has_archive</code> .','Should the permalink structure provide for pagination. Defaults to true.'=>'La structure en permalien devrait-elle prévoir une pagination? La valeur par défaut est true.','Add an "Archive" Options Page as submenu of the post type.'=>'Ajoutez une page d’options "Archive" comme sous-menu du type de publication.','Number of posts to display on the admin list screen. Default: 10'=>'Nombre de messages à afficher sur l’écran de la liste d’administration. Valeur par défaut : 10','Sort retrieved posts by parameter in the admin list screen. Default: date (<code>post_date</code>).'=>'Triez les posts récupérés sur l’écran de liste de l\'administration. Valeur par défaut : date (<code>post_date</code>).','Designates the ascending or descending order of the <code>orderby</code> parameter in the admin list screen. Default: DESC.'=>'Désigne l’ordre croissant ou décroissant du paramètre sur l’écran de liste de l\'administration <code>orderby</code> . Valeur par défaut : DESC.','Custom field used for the <code>orderby</code> parameter in the admin list screen'=>'Champ personnalisé utilisé pour le <code>orderby</code> paramètre sur l’écran de liste de l\'administration','Custom field type (NUMERIC, BINARY, CHAR, DATE, DATETIME, DECIMAL, SIGNED, TIME, UNSIGNED) used for the <code>orderby</code> parameter in the admin list screen'=>'Type de champ personnalisé (NUMERIC, BINARY, CHAR, DATE, DATETIME, DECIMAL, SIGNED, TIME, UNSIGNED) utilisé pour le paramètre <code>orderby</code> sur l’écran de liste de l\'administration','The string to use to build the read, edit, and delete capabilities.<br />May be passed as an array to allow for alternative plurals when using this argument as a base to construct the capabilities, like this:<br /><br />story<br />stories'=>'Chaîne à utiliser pour créer les fonctionnalités de lecture, de modification et de suppression.<br />Peut être passé sous la forme d’un tableau pour permettre d’autres pluriels lors de l’utilisation de cet argument comme base pour construire les capacités, comme ceci :<br /><br />story<br />stories','An array of the capabilities for this post type. Specify capabilities like this:<br /><br />edit_post : edit_book<br />read_post : read_book<br />delete_post : delete_book<br />edit_posts : edit_books<br />publish_posts : publish_books<br />etc...'=>'Tableau des fonctionnalités de ce type de publication. Spécifiez des fonctionnalités comme celle-ci :<br /><br />edit_post : edit_book<br />read_post : read_book<br />delete_post : delete_book<br />edit_posts : edit_books<br />publish_posts : publish_books<br />etc...','Whether to use the internal default meta capability handling. Default: null.<br/><br/>If set it to false then standard admin role can\'t edit the posts types. Then the <code>edit_post</code> capability must be added to all roles to add or edit the posts types.'=>'S’il faut utiliser la gestion interne des méta par défaut. Valeur par défaut : null.<br/><br/>S’il est défini sur false, le rôle d’administrateur standard ne peut pas modifier les types de publication. Ensuite, la fonctionnalité <code>edit_post</code> doit être ajoutée à tous les rôles pour ajouter ou modifier les types de publications.','Whether to expose this post type in the REST API. Must be true to enable the Gutenberg editor. Default: false.'=>'S’il faut exposer ce type de publication dans l’API REST. Doit être true pour activer l’éditeur Gutenberg. Valeur par défaut : false.','The base slug that this post type will use when accessed using the REST API: Default: <code>name</code>.'=>'Le slug de base que ce type de publication utilisera lors de l’accès à l’aide de l’API REST : Valeur par défaut : <code>name</code>.','An optional custom controller to use instead of <a href="https://developer.wordpress.org/reference/classes/wp_rest_posts_controller/" target="_blank">WP_REST_Posts_Controller</a>. Must be a subclass of <a href="https://developer.wordpress.org/reference/classes/wp_rest_controller/" target="_blank">WP_REST_Controller</a>. Default: <a href="https://developer.wordpress.org/reference/classes/wp_rest_posts_controller/" target="_blank">WP_REST_Posts_Controller</a>.'=>'Un contrôleur personnalisé facultatif à utiliser à la place de <a href="https://developer.wordpress.org/reference/classes/wp_rest_posts_controller/" target="_blank">WP_REST_Posts_Controller</a>. Doit être une sous-classe de <a href="https://developer.wordpress.org/reference/classes/wp_rest_controller/" target="_blank">WP_REST_Controller</a>. Valeur par défaut : <a href="https://developer.wordpress.org/reference/classes/wp_rest_posts_controller/" target="_blank">WP_REST_Posts_Controller</a>.','Edit Post Type'=>'Editer le type de publication','New Post Type'=>'Nouveau type de publication','Post Type Label'=>'Nom du type de publication','Export Post Types'=>'Exporter des types de publication','Select Post Types'=>'Sélectionnez le type article','No post type available.'=>'Aucun type de publication dynamique disponible.','No post types selected'=>'Aucun type de publication sélectionné','1 post type exported'=>'1 type de publication exporté','%s post types exported'=>'%s types de publication exportés','It is recommended to include this code within the <code>init</code> hook (<a href="%s" target="blank">see documentation</a>).'=>'Il est recommandé d’inclure ce code dans le hook <code>init</code> (<a href="%s" target="blank">voir documentation</a>).','Import Post Types'=>'Importer des types de publication','1 post type imported'=>'1 type de publication importé','%s post types imported'=>'%s types de publication importés','This post type already exists'=>'Ce type de publication existe déjà','This post type is reserved'=>'Ce type de publication est réservé','The name of the taxonomy. Name should only contain lowercase letters and the underscore character, and not be more than 32 characters long (database structure restriction)'=>'Nom de la taxonomie. Le nom ne doit contenir que des lettres minuscules et le caractère de soulignement, et ne doit pas dépasser 32 caractères (restriction de structure de la base de données)','Include a description of the taxonomy'=>'Ajouter une description de la taxonomie','Is this taxonomy hierarchical (have descendants) like categories or not hierarchical like tags. Default: false'=>'Cette taxonomie est-elle hiérarchique (avec des descendants) comme des catégories ou non hiérarchique comme les tags. Valeur par défaut : false','The name of the object type for the taxonomy object. Object-types can be built-in Post Type or any Custom Post Type that may be registered. Default is None.'=>'Nom du type d’objet de l’objet de taxonomie. Les types d’objets peuvent être des types de publication intégrés ou tout type de publication personnalisé pouvant être enregistré. La valeur par défaut est Aucun.','Whether a taxonomy is intended for use publicly either via the admin interface or by front-end users. The default settings of <code>publicly_queryable</code>, <code>show_ui</code>, and <code>show_in_nav_menus</code> are inherited from <code>public</code>. Default: true.'=>'Si une taxonomie est destinée à être utilisée publiquement, soit via l’interface d’administration, soit par les utilisateurs frontaux. Les paramètres par défaut de <code>publicly_queryable</code>, <code>show_ui</code>, et <code>show_in_nav_menus</code> sont hérités de <code>public</code>. Valeur par défaut : true.','Whether the taxonomy is publicly queryable. Default: value of <code>public</code>'=>'Si la taxonomie est publiquement visible. Valeur par défaut : valeur de <code>public</code>','A function name that will be called when the count of an associated <code>object_type</code>, such as post, is updated. Works much like a hook. Default: None.'=>'Nom de fonction qui sera appelé lors de la mise à jour du nombre d’un <code>object_type</code>, tel qu\'un post. Fonctionne un peu comme un hook. Valeur par défaut : Aucune.','Provide a callback function for the meta box display. If not set, <a href="https://developer.wordpress.org/reference/functions/post_categories_meta_box/" target="_blank">post_categories_meta_box()</a> is used for hierarchical taxonomies, and <a href="https://developer.wordpress.org/reference/functions/post_tags_meta_box/" target="_blank">post_tags_meta_box()</a> is used for non-hierarchical. If false, no meta box is shown. Default: null.'=>'Fournissez une fonction de retour pour l’affichage de la meta box. S’il n’est pas défini, <a href="https://developer.wordpress.org/reference/functions/post_categories_meta_box/" target="_blank">post_categories_meta_box()</a> est utilisé pour les taxonomies hiérarchiques et <a href="https://developer.wordpress.org/reference/functions/post_tags_meta_box/" target="_blank">post_tags_meta_box()</a> est utilisé pour les taxonomies non hiérarchiques. Si la valeur est false, aucune meta-box n’est affichée. Valeur par défaut : null.','Whether terms in this taxonomy should be sorted in the order they are provided to <code>wp_set_object_terms()</code>. Default null which equates to false.'=>'Si les termes de cette taxonomie doivent être triés dans l’ordre dans lequel ils sont fournis à <code>wp_set_object_terms()</code>. Valeur par défaut null égale à false.','Whether to generate and allow a UI for managing terms in this taxonomy in the admin. Default: value of <code>public</code>.'=>'S’il faut générer et autoriser une interface utilisateur pour gérer les termes de cette taxonomie dans l’administration. Valeur par défaut : valeur de <code>public</code>.','Whether to show the taxonomy in the admin menu. If true, the taxonomy is shown as a submenu of the object type menu. If false, no menu is shown. <code>show_ui</code> must be true. Default: value of <code>show_ui</code>.'=>'S’il faut afficher la taxonomie dans le menu d’administration. Si la valeur est true, la classification est affichée sous la forme d’un sous-menu du menu Type d’objet. Si la valeur est false, aucun menu ne s’affiche. <code>show_ui</code> doit être vrai. Valeur par défaut : valeur de <code>show_ui</code>.','Makes this taxonomy available for selection in navigation menus. Default: value of <code>public</code>.'=>'Permet de sélectionner cette taxonomie dans les menus de navigation. Valeur par défaut : valeur de <code>public</code>.','Whether to list the taxonomy in the Tag Cloud Widget controls. Default: value of <code>show_ui</code>.'=>'S’il faut répertorier la taxonomie dans les contrôleurs Tag Cloud Widget. Valeur par défaut : valeur de <code>show_ui</code>.','Whether to show the taxonomy in the quick/bulk edit panel. Default: value of <code>show_ui</code>.'=>'S’il faut afficher la taxonomie dans le panneau d’édition rapide/groupée. Valeur par défaut : valeur de <code>show_ui</code>.','Whether to display a column for the taxonomy on its post type listing screens. Default: false.'=>'S’il faut afficher une colonne pour la taxonomie sur ses écrans de liste de type de publication. Valeur par défaut : false.','Which template file to load for the archive query. Default: <a href="https://developer.wordpress.org/themes/basics/template-hierarchy/">Template hierarchy</a>'=>'Fichier de modèle à charger pour la requête d’archive. Valeur par défaut : <a href="https://developer.wordpress.org/themes/basics/template-hierarchy/">Hiérarchie des modèles</a>','Sort retrieved posts by parameter in the archive page. Defaults: date (<code>post_date</code>).'=>'Triez les posts récupérés par sur la page d’archive. Valeur par défaut : date (<code>post_date</code>).','Designates the ascending or descending order of the <code>orderby</code> parameter in the archive page. Defaults: DESC.'=>'Désigne l’ordre croissant ou décroissant du paramètre <code>orderby</code> sur la page d’archive. Valeur par défaut : DESC.','Set to false to prevent automatic URL rewriting a.k.a. "pretty permalinks". Pass an argument array to override default URL settings for permalinks'=>'Réglez sur false pour empêcher la réécriture automatique des URL alias « pretty permalinks ». Transmettre un tableau d’arguments pour remplacer les paramètres d’URL par défaut pour les permaliens','Used as pretty permalink text (i.e. <code>/tag/</code>). Default: value of <code>name</code>'=>'Utilisé comme texte de permalien (c’est-à-dire <code>/tag/</code>). Valeur par défaut : valeur de <code>name</code>','Allowing permalinks to be prepended with front base. Default: true.'=>'Permettre aux permaliens d’être précédés de la base "front". Valeur par défaut : true.','Either hierarchical rewrite tag or not. Default: false.'=>'Balise de réécriture hiérarchique ou non. Valeur par défaut : false.','Number of terms to display on the admin list screen'=>'Nombre de termes à afficher sur l’écran de liste de l\'administration','Sort retrieved terms by parameter in the admin list screen. Accepts term fields <code>name</code>, <code>slug</code>, <code>term_group</code>, <code>term_id</code>, <code>id</code>, <code>description</code>, <code>parent</code>, <code>count</code> (for term taxonomy count), or <code>none</code> to omit the ORDER BY clause'=>'Triez les termes récupérés sur l’écran de liste de l\'administration. Accepte les champs <code>name</code>, <code>slug</code>, <code>term_group</code>, <code>term_id</code>, <code>id</code>, <code>description</code>, <code>parent</code>, <code>count</code> (pour le nombre de taxonomies de termes), ou <code>none</code> pour omettre la clause ORDER BY','Designates the ascending or descending order of the <code>orderby</code> parameter in the admin list screen. Default: ASC.'=>'Désigne l’ordre croissant ou décroissant du paramètre <code>orderby</code> sur l’écran de liste de l\'administration. Valeur par défaut : ASC.','An array of labels for this taxonomy. By default tag labels are used for non-hierarchical types and category labels for hierarchical ones.<br /><br />Default: if empty, <code>name</code> is set to <code>label</code> value, and <code>singular_name</code> is set to <code>name</code> value.'=>'Tableau d’étiquettes pour cette taxonomie. Par défaut, les étiquettes de balise sont utilisées pour les types non hiérarchiques et les étiquettes de catégorie pour les types hiérarchiques.<br /><br />Valeur par défaut : si vide, <code>name</code> est défini sur <code>label</code> valeur et <code>singular_name</code> valeur définie <code>name</code> .','An array of the capabilities for this taxonomy:<br /><br />manage_terms : edit_posts<br />edit_terms : edit_posts<br />delete_terms : edit_posts<br />assign_terms : edit_posts'=>'Un tableau des capacités de cette taxonomie :<br /><br />manage_terms : edit_posts<br />edit_terms : edit_posts<br />delete_terms : edit_posts<br />assign_terms : edit_posts','Whether to include the taxonomy in the REST API. You will need to set this to true in order to use the taxonomy in your gutenberg metablock. Default: false.'=>'S’il faut inclure la taxonomie dans l’API REST. Vous devrez définir cela sur true afin d’utiliser la taxonomie dans votre métabloc gutenberg. Valeur par défaut : false.','To change the base url of REST API route. Default: <code>name</code>.'=>'Pour modifier l’URL de base de la route de l’API REST. Valeur par défaut : <code>name</code>.','Edit Taxonomy'=>'Editer la Taxonomie','New Taxonomy'=>'Nouvelle Taxonomie','Taxonomy Label'=>'Nom de la taxonomie','Export Taxonomies'=>'Exporter les taxonomies','Select Taxonomies'=>'Type de taxonomies','No taxonomy available.'=>'Aucune taxonomie dynamique disponible.','No taxonomies selected'=>'Aucune taxonomie sélectionnée','1 taxonomy exported'=>'1 taxonomie exportée','%s taxonomies exported'=>'%s taxonomies exportées','Import Taxonomies'=>'Importer des Taxonomies','1 taxonomy imported'=>'1 taxonomie importée','%s taxonomies imported'=>'%s taxonomies im