%s éléments dupliqués.','Duplicate this item'=>'Dupliquer cet élément','Sync from Database'=>'Synchroniser depuis la Base de Données','Sync from JSON file'=>'Synchroniser depuis le fichier JSON','Sync from PHP file'=>'Synchroniser depuis le fichier PHP','Invalid parameter(s).'=>'Paramètre(s) invalide(s)','Sorry, this item is unavailable for diff comparison.'=>'Désolé, cet élément est indisponible à la comparaison.','Database item'=>'Elément de Base de Données','JSON file'=>'Fichier JSON','PHP file'=>'Fichier PHP','Last updated: %s'=>'Dernière mise à jour: %s','No orphan meta found'=>'Aucune donnée meta orpheline trouvée','Deleted meta'=>'Meta supprimées','Object data'=>'Données objet','Meta count'=>'Nombre de meta','Clean'=>'Nettoyer','Performance'=>'Performance','Post Object'=>'Objet de l\'article','Term Object'=>'Objet du terme','User Object'=>'Objet utilisateur','Options Page Object'=>'Objet de Page Options','Post Type Object'=>'Object du type de publication','Taxonomy Object'=>'Objet de la taxonomie','Users'=>'Utilisateurs','Option action'=>'Action d\'option','Which ACF fields should have their values loaded'=>'Sélectionner les champs ACF dont les valeurs doivent être chargées','Ajax submission'=>'Soumission Ajax','Enable Ajax form submission'=>'Activer la soumission de formulaire Ajax','Set as Global Conditional Logic'=>'Définir comme logique conditionnelle globale','Rewrite Rules'=>'Règles de réécriture','No options pages'=>'Aucune pages d’options','Script finished.'=>'Script terminé.','Script'=>'Script','Scripts'=>'Scripts','No scripts avaliable.'=>'Aucun script disponible.','Run now'=>'Exécuter maintenant','Sorry, you are not allowed to access this page.'=>'Désolé, vous n\'êtes pas autorisé à accéder à cette page.','Total'=>'Total','Items left'=>'Objets restants','Time left'=>'Temps restant','Timer'=>'Minuteur','Template'=>'Modèle','is equal to'=>'est égal à','No templates found'=>'Aucun modèle trouvé','The template name.'=>'Nom du modèle.','The Dynamic Templates module let you manage default ACF values in an advanced way. In order to start, you need to connect a field group to a specific template. Head over the Field Groups administration, select the field group of your choice and scroll down to the location settings. To connect a field group to a template, choose a classic location (like Post Type = Post) and add a new rule using the “AND” operator. Select the rule "Dynamic Template" under "Forms", then choose your template and save the field group.'=>'Le module Modèles dynamiques vous permet de gérer les valeurs ACF par défaut de manière avancée. Pour commencer, vous devez connecter un groupe de champs à un modèle spécifique. Rendez-vous sur l’administration des groupes de champs, sélectionnez le groupe de champs de votre choix et faites défiler jusqu’aux paramètres d’emplacement. Pour connecter un groupe de champs à un modèle, choisissez un emplacement classique (comme Type de publication = Post) et ajoutez une nouvelle règle à l’aide de l’opérateur « ET ». Sélectionnez la règle « Modèle dynamique » sous « Formulaires », puis choisissez votre modèle et enregistrez le groupe de champs.','You can now fill up the template page, values will be automatically loaded for the location it is tied to if the user never saved anything. In this screenshot, there is a different template for the "Post Type: Page" & the "Post Type: Post" while using the same field group.'=>'Vous pouvez maintenant remplir la page du modèle, les valeurs seront automatiquement chargées pour l’emplacement auquel elle est liée si l’utilisateur n’a jamais rien enregistré. Dans cette capture d’écran, il existe un modèle différent pour le « Type de publication: Page » et le « Type de publication: Publication » tout en utilisant le même groupe de champs.','The Dynamic Template design is smart enough to fulfill complex scenarios. For example, one single template can be used in conjunction with as many field group location as needed. It is also possible to add multiple field groups into a single template to keep things organized.'=>'La conception du modèle dynamique est suffisamment intelligente pour répondre à des scénarios complexes. Par exemple, un seul modèle peut être utilisé conjointement avec autant d’emplacements de groupe de champs que nécessaire. Il est également possible d’ajouter plusieurs groupes de champs dans un seul modèle pour garder les choses organisées.','<u>Note:</u> Template values will be loaded when the user haven\'t saved any data related to the said values. Typically in a "New Post" situation. If the user save a value, even an empty one, the template won\'t be loaded.'=>'<u>Note:</u> Le modèle sera chargé sur une page dans le cas où l’utilisateur n\'a jamais sauvegardé de meta donnée. Généralement dans une situation de « création d\'article ». Si l’utilisateur enregistre une meta-donnée, même vide, le modèle ne sera pas chargé.','Edit Template'=>'Modifier le modèle','New Template'=>'Nouveau modèle','Template Title'=>'Titre du Modèle','Export Templates'=>'Exporter des modèles','Select Templates'=>'Sélectionner les modèles','No template available.'=>'Aucun modèle disponible.','No templates selected'=>'Aucun modèle sélectionné','1 template exported'=>'1 modèle exporté','%s templates exported'=>'%s modèles exportés','Import Templates'=>'Importer un modèle','1 template imported'=>'1 modèle importé','%s templates imported'=>'%s modèles importés','Locations'=>'Emplacements','You are currently editing a Dynamic Template.'=>'Vous modifiez actuellement un modèle dynamique.','This template already exists'=>'Ce modèle existe déjà','There is a new version of %1$s available. %2$sView version %3$s details%4$s.'=>'Il existe une nouvelle version disponible de %1$s. %2$s Afficher la version %3$s details %4$s.','There is a new version of %1$s available. %2$sView version %3$s details%4$s or %5$supdate now%6$s.'=>'Il y a une nouvelle version disponible de %1$s. %2$s Afficher la version %3$s détails %4$s ou %5$s mettre à jour maintenant %6$s.','You do not have permission to install plugin updates'=>'Vous n’avez pas la permission d’installer les mises à jour de l’extension','Error'=>'Erreur','Deactivate License'=>'Désactiver la licence','Activate License'=>'Activer la licence','ACF Extended: License Information'=>'ACF Extended : informations de licence','License Key'=>'Clé de licence','Manage License'=>'Gérer la license','To unlock updates, please enter your license key below. If you don\'t have a licence key, please see <a href="%s" target="_blank">details & pricing</a>.'=>'Pour débloquer les mises à jour, veuillez saisir votre clé de licence ci-dessous. Si vous n’en possédez pas encore une, jetez un œil à nos <a href="%s" target="_blank">détails & tarifs</a>.','Don\'t have an ACF PRO license? %s'=>'Vous n\'avez pas de license ACF Extended Pro? %s','License Status'=>'Status de la license','View pricing & purchase'=>'Voir les prix & acheter','ACF Extended: Update Information'=>'ACF Extended : informations de mise à jour','Current Version'=>'Version Actuelle','Latest Version'=>'Dernière version','Update Available'=>'Mise à jour disponible','Update Plugin'=>'Mettre à jour l\'extension','Please enter your license key above to unlock updates'=>'Ajouter une clé pour obtenir les futures mise à jour','Check Again'=>'Vérifier à nouveau','Check For Updates'=>'Vérifier les mises à jour','Changelog'=>'Changelog','An error occurred, please try again.'=>'Une erreur est survenue, veuillez réessayer.','Your license key has expired.'=>'Votre clé de licence a expiré.','Your license key has been disabled.'=>'Votre clé de licence a été désactivée.','Licence key invalid.'=>'Clé de licence non valide.','Your license is not active for this URL.'=>'Votre licence n\'est pas active pour cette URL.','This appears to be an invalid license key for ACF Extended Pro.'=>'Cette clé de licence semble être invalide pour ACF Extended Pro.','Your license key has reached its activation limit.'=>'Votre clé de licence a atteint sa limite d\'activation.','<b>Licence key activated</b>. Updates are now enabled.'=>'<b>Clé de licence activée</b>. Les mises à jour sont maintenant activées.','Advanced Custom Fields: Extended PRO'=>'Advanced Custom Fields: Extended PRO','https://www.acf-extended.com'=>'https://www.acf-extended.com','All-in-one enhancement suite that improves WordPress & Advanced Custom Fields.'=>'Suite d’amélioration tout-en-un qui améliore WordPress & Advanced Custom Fields.','ACF Extended'=>'ACF Extended']];
